import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [userData, setUserData] = useState(null);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('https://d3398n96t5wqx9.cloudfront.net/UsersAquisition/');
      setUserData(response.data); // Assuming response.data is structured according to API docs
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>MobiBox Users Acquisition Page</h1>
      </header>
      <main>
        {userData ? (
          <div className="user-data">
            <h2>User Data</h2>
            <p>User ID: {userData.userId}</p>
            {/* Render other relevant user data as per API response */}
          </div>
        ) : (
          <p>Loading...</p>
        )}
      </main>
      <footer>
        <p>&copy; 2024 MobiBox</p>
      </footer>
    </div>
  );
}

export default App;
